// tasks.js
/*
 * Auto-generated script using FullCalendar to display policy tasks in a monthly grid.
 */
function initializeApp(tasksData) {
  let saved;
  try {
    saved = JSON.parse(localStorage.getItem('taskStatus')) || {};
  } catch (e) {
    saved = {};
  }
  const events = tasksData.map((task, idx) => {
    const isCompleted = saved[idx] && saved[idx].completed_by && saved[idx].completed_by.trim() !== '';
    const color = isCompleted ? '#4caf50' : '#3788d8';
    return {
      id: String(idx),
      title: task.policy + ': ' + (task.task.length > 50 ? task.task.substring(0,47) + '...' : task.task),
      start: task.due_date,
      backgroundColor: color,
      borderColor: color,
      extendedProps: { description: task.task, policy: task.policy, periodicity: task.periodicity, index: idx }
    };
  });
  const calendarEl = document.getElementById('calendar');
  const calendar = new FullCalendar.Calendar(calendarEl, {
    plugins: [ dayGridPlugin ],
    initialView: 'dayGridMonth',
    height: 650,
    headerToolbar: { left: 'prev,next today', center: 'title', right: '' },
    events: events,
    eventDidMount: function(info) {
      let tooltip = document.createElement('div');
      tooltip.className = 'fc-tooltip';
      tooltip.style.position = 'absolute';
      tooltip.style.zIndex = '10001';
      tooltip.style.background = 'rgba(0,0,0,0.75)';
      tooltip.style.color = '#fff';
      tooltip.style.padding = '6px 10px';
      tooltip.style.borderRadius = '4px';
      tooltip.style.fontSize = '12px';
      tooltip.style.display = 'none';
      tooltip.innerHTML = '<strong>' + info.event.extendedProps.policy + '</strong><br>' + info.event.extendedProps.description;
      document.body.appendChild(tooltip);
      info.el.addEventListener('mouseenter', () => { tooltip.style.display = 'block'; });
      info.el.addEventListener('mouseleave', () => { tooltip.style.display = 'none'; });
      info.el.addEventListener('mousemove', (e) => {
        tooltip.style.left = e.pageX + 12 + 'px';
        tooltip.style.top = e.pageY + 12 + 'px';
      });
    }
  });
  calendar.render();
  // Build table
  const tbody = document.querySelector('#task-table tbody');
  tasksData.forEach((task, idx) => {
    const row = document.createElement('tr');
    [idx + 1, task.policy, task.task, task.periodicity, task.due_date].forEach(text => {
      const td = document.createElement('td');
      td.textContent = text;
      row.appendChild(td);
    });
    const tdComp = document.createElement('td');
    const inputComp = document.createElement('input');
    inputComp.type = 'text';
    inputComp.placeholder = 'Name';
    inputComp.value = saved[idx] ? saved[idx].completed_by || '' : '';
    inputComp.addEventListener('input', (e) => {
      const ver = saved[idx] ? saved[idx].verified_by || '' : '';
      saveStatus(idx, e.target.value, ver);
      const event = calendar.getEventById(String(idx));
      const isNowComplete = e.target.value && e.target.value.trim() !== '';
      const newColor = isNowComplete ? '#4caf50' : '#3788d8';
      if (event) {
        event.setProp('backgroundColor', newColor);
        event.setProp('borderColor', newColor);
      }
    });
    tdComp.appendChild(inputComp);
    row.appendChild(tdComp);
    const tdVer = document.createElement('td');
    const inputVer = document.createElement('input');
    inputVer.type = 'text';
    inputVer.placeholder = 'Verifier';
    inputVer.value = saved[idx] ? saved[idx].verified_by || '' : '';
    inputVer.addEventListener('input', (e) => {
      const comp = saved[idx] ? saved[idx].completed_by || '' : '';
      saveStatus(idx, comp, e.target.value);
    });
    tdVer.appendChild(inputVer);
    row.appendChild(tdVer);
    tbody.appendChild(row);
  });
  function saveStatus(index, compBy, verBy) {
    saved[index] = { completed_by: compBy, verified_by: verBy };
    localStorage.setItem('taskStatus', JSON.stringify(saved));
  }
}

